import React from 'react'
import { useState } from 'react'
const List = () => {
 
  const [items,setItems] =useState(
    [
      {
        id:1,
        checked:true,
        item:"Reserve the Bus Ticket"
      },
      {
        id:1,
        checked:true,
        item:"Cancel the Bus Ticket"
      },
      {
        id:1,
        checked:true,
        item:"Timings of the Bus"
      },
      {
        id:1,
        checked:true,
        item:"Date of the Bus"
      }

    ]
  );
 
  return (
    <div>
      <p>To Do List</p>
      <ul>
          {}

      </ul>
    </div>
  )
}

export default List
